import mem1 from "../images/mem1.jpeg"
import { NavLink } from "react-router-dom";

const MEMS = [
    {
        title: "Mem 1",
        img: mem1,
    },
];

export const memList = () => {
    return (
        <div>
            Mem:
            <ul>
                {MEMS.map((mem) => {
                    return (
                        <li key={mem.title}>

                        </li>
                    );
                })}
            </ul>
        </div>
    );
}



